import React, { useState } from 'react';
import './index.css';

const App = () => {
    const [count , stepFun] = useState(0);

    const IncNum = () => {
         stepFun(count+1);
    }

    return(
        <>
           <div> {count}</div>
           <button onClick= {IncNum} > Click</button>
        </>
    );
};

export default App;
